import "./CostDate1.css";

function CostDate1(props) {
  const costDate = props.date;
  console.log(props);

  return (
    <div className=" cost-date">
      <div>{costDate.toLocaleString("ru-RU", { month: "long" })}</div>
      <div>{costDate.getFullYear()}</div>
      <div>{costDate.toLocaleString("ru-RU", { day: "2-digit" })}</div>
    </div>
  );
}

export default CostDate1;
